function downloadImage(url) {
	return new Promise((resolve, reject) => {
		const options = {
			url: url,
			dest: '../../raw_photo.jpeg'
		};
		image_downloader.image(options).then(({ filename }) => {
			console.log('Saved to ' + filename);
			resolve();
		}).catch((err) => {
			console.log(err);
			reject(err);
		});
	});
}

